function Owl() {
  return (
    <OwlCarousel
      className='owl-theme '
      margin={10}
      responsiveRefreshRate={200}
      responsive={{
        0: {
          autoWidth: true,
        },

        1000: {
          items: 11,
        },
      }}
      nav
    >
      <div className='item'>
        <AllList Brand={<IPhone14Pro />} />{" "}
      </div>
      <div className='item'>
        <AllList Brand={<IPhone14 />} />
      </div>
      <div className='item'>
        <AllList Brand={<Iphon13 />} />
      </div>
      <div className='item'>
        <AllList Brand={<IphonSE />} />
      </div>
      <div className='item'>
        <AllList Brand={<Iphon12 />} />
      </div>
      <div className='item'>
        <AllList Brand={<Compare />} />
      </div>
      <div className='item'>
        <AllList Brand={<AirPods />} />
      </div>
      <div className='item'>
        <AllList Brand={<AirTag />} />
      </div>
      <div className='item'>
        <AllList Brand={<Accessories />} />
      </div>
      <div className='item'>
        <AllList Brand={<IOS16 />} />
      </div>
      <div className='item'>
        <AllList Brand={<Shop />} />
      </div>
    </OwlCarousel>
  );
}

function AllList(props) {
  return (
    <Col>
      <Nav.Link className='chapternav-item'>{props.Brand}</Nav.Link>
    </Col>
  );
}

//>>>Header<<<
function Header() {
  return (
    <Container className='mt-3'>
      <Row>
        <Owl />
      </Row>
    </Container>
  );
}
export default Header;
